const Hello = (props) => {
  console.log(props);
  return (
    <div>
      <p>Hello, My name is {props.name} and my age is {props.age}</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>

      <Hello name = 'Beet' age = '16'/>
      <Hello />
    </div>
  )
}

export default App;
